import React from 'react';
import useWebSocket from 'react-use-websocket';

import './App.css';

const WS_URL = 'wss://betlive.oservices.me/ws';

function App() {
	useWebSocket(WS_URL, {
		onOpen: () => {
			console.log('WebSocket connection established.');
		}
	});

	return (
		<div>Hello WebSockets!</div>
	);
}

export default App;
